int lengthOfLongestSubstring(string s)
{
    int maxlen=0,tmplen=0;
    int i=0,j=0;
    int pos[256];
    for(int i=0;i<256;i++) pos[i]=-1;
    int start=0;
    for(i=0;i<s.size();i++)
    {
        if(pos[s[i]]>=start)
        {
            start=pos[s[i]]+1;
            tmplen=i-start;
        }
        if(pos[s[i]]<start) tmplen++;
        pos[s[i]]=i;
        if(tmplen>maxlen) maxlen=tmplen;
    }
    return maxlen;
}
